('035137ca-06d7-4d99-b40e-c4a4a708f4bc', 'Cho thuê nhà mặt tiền Cư Xá Lữ Gia, DT 64m2, 1 trệt, 1 gác, giá 14 triệu/tháng', '0', 'XYI1', 'Địa chỉ: Lữ Gia, Phường 15, Quận 11, Hồ Chí Minh', '06d5db8d-3f99-4f8a-982b-5558113aa924', 'NCT', '[\"Cần cho thuê nhà tại khu cư xá Lữ Gia, Phường 15, Quận 11, TP.HCM, với diện tích rộng rãi và vị trí thuận tiện:\",\"Địa chỉ: Đường Lữ Gia, Phường 15, Quận 11, TP. Hồ Chí Minh\",\"Diện tích: 64m² (kích thước 4 x 16m), bao gồm 1 trệt và 1 gác lửng, không gian rộng rãi.\",\"Thiết kế: Gồm 1 phòng ngủ, 1 nhà vệ sinh và 1 phòng tắm, nhà trống sẵn sàng để dọn vào ở ngay.\",\"Hẻm rộng: Xe hơi ra vào thoải mái, phù hợp cho kinh doanh online, mở văn phòng hoặc làm kho chứa hàng.\",\"Giá cho thuê: 14 triệu đồng/tháng, có thể thương lượng thêm.\",\"Liên hệ xem nhà: 0888 712 323\"]', '7ae14fda-3f79-41f3-866c-b014b103502e', '51c74878-e1ca-488c-9812-6de1de41a621', '97f394ef-57e8-4da9-9beb-3b7c7282789a', '2024-09-20 16:09:10', '2024-09-20 16:09:10'),
