('06d0b3ec-02ac-42a8-851d-a46dea494ee0', 'Ở GHÉP KHU CHUNG CƯ CAO CẤP HAUSNEO QUẬN 9', '0', 'BQB9', 'Địa chỉ: Chung cư Hausneo 11, Phường Phú Hữu, Quận 9, Hồ Chí Minh', 'fd0135ec-49d6-4037-8a22-c2b78ff73b41', 'TNOG', '[\"Ở GHÉP KHU CHUNG CƯ CAO CẤP HAUSNEO QUẬN 9\",\"Địa Chỉ: Căn hộ Hausneo, Đường số 11, P. Phú Hữu, Tp. Thủ Đức (Quận 9 cũ) thuộc KDC Phú Hữu, Quận 9 yên tĩnh, nhiều cây xanh.\",\"Diện tích: 73m2 - Kết cấu: 2 phòng ngủ và 2 toilet, phòng khách.\",\"Nhờ vị trí cạnh Cao tốc TP.HCM - Long Thành - Dầu Giây (nút giao Đỗ Xuân Hợp) cư dân căn hộ Hausneo có thể di chuyển thuận lợi:\",\"- Chỉ vài bước chân là đến Quận 2,\",\"- Cách Thành phố mới Thủ Thiêm chỉ 5 phút\",\"- 15 - 20 phút : vào trung tâm Quận 1, Quận 4, Bình Thạnh\",\"- 18 phút: Vincom Plaza, ngã tư Bình Thái\",\"- 25 phút đến Phú Mỹ Hưng, Quận 7 qua đường vành đai trong - cầu Phú Mỹ\",\"- Đi về trong ngày: Đồng Nai, Vũng Tàu, Bình Dương\",\"- Gần Khu Công Nghệ Cao, FPT Software, Đại Học FPT, Công Ty Samsung, Nidec, Jabil, intel.\",\"Nội Thất:\",\"•Giường Tầng.\",\"•Máy Lạnh.\",\"•Tủ Lạnh, Bếp Từ, Tủ Bếp Cao Cấp.\",\"•Máy Giặt, Sân Phơi Đồ.\",\"•Tủ Quần Áo, Bàn Làm Việc.\",\"•Máy nước nóng, lạnh rất phù hợp cho các bạn thích tắm nước nóng.\",\"Tiện Ích:\",\"•Môi Trường Sống Cao Cấp.\",\"•Hồ Bơi Miễn Phí.\",\"•Phòng Tập Gym Cao Cấp.\",\"•Công Viên Cây Xanh.\",\"•Có hầm để xe rộng rãi.\",\"•Có view cực rộng ngắm thành phố cực chill để thư giãn ^^\",\"•Cửa khóa điện tử, bảo vệ nghiêm ngặt đảm bảo an ninh\",\"•Wifi kết nối đầy đủ tốc độ cao.\",\"•Giờ giấc tự do đi lại.\",\"Khách Hàng:\",\"Khách Hàng Của Chúng Tôi Là Những Nhân Viên Văn Phòng, Sinh Viên Đại Học, Có Văn Hóa, Ý Thức Để Cùng Nhau Xây Dựng Một Môi Trường Sống Văn Minh Tiện Lợi Với Mức Giá Hợp Lý.\",\"Bạn còn chần chừ gì nữa háy nhấc máy đặt phòng ngay,vì số lượng có hạn,chỉ còn trống vài xuất là hết chỗ.\",\"Giá Thuê : 1.600.000 (Đã bao gồm phí quản lý và wifi), Điện Nước Tính Theo Hóa Đơn Nhà Nước.\",\"Liên Hệ: 0899.311.197 (Mr.An) hoặc zalo 0899.311.197\"]', '6aff027b-45e8-476c-ab00-abe08b4c4d2a', 'b1d5fae0-c54f-4af6-a442-1c833ec5a675', '1702e359-52d4-481e-94e1-7fa2aacd6490', '2024-09-20 16:13:21', '2024-09-20 16:13:21'),
('06d3ed35-7a30-4532-ae8e-388c83416c5b', 'Sleep box cao cấp đầy đủ tiện nghi , yên tĩnh khép kín ngay trung tâm Quận 11', '0', 'TUQ3', 'Địa chỉ: Lê Đại Hành, Phường 11, Quận 11, Hồ Chí Minh', 'a6271381-d893-4f3c-be6f-f1aed91528e1', 'TNOG', '[\"Thông tin về phòng trọ ở ghép giá rẻ, đầy đủ tiện nghi tại Quận 11:\",\"Địa chỉ:\",\"457 Lê Đại Hành, Phường 11, Quận 11 (ngay vòng xoay Lê Đại Hành).\",\"Giá thuê:\",\"Chỉ 1.6 triệu/tháng (bao gồm chi phí điện, nước, rác, Wi-Fi).\",\"Gửi xe: 150k/tháng (nếu cần).\",\"Vị trí thuận tiện di chuyển:\",\"Gần các tuyến đường: Lê Đại Hành, Bình Quới, Âu Cơ, Nguyễn Thị Nhỏ, Ba Tháng Hai...\",\"Di chuyển nhanh đến các Quận trung tâm: Quận 11, Quận 10, Quận 5, Quận 6, Quận Tân Bình, Tân Phú.\",\"Gần các trường Đại học: ĐH Bách Khoa (cách 900m), ĐH Sư Phạm, ĐH Văn Hiến.\",\"Gần Công Viên nước Đầm Sen, Công Viên Lê Thị Riêng, Bệnh Viện Tân Phú, BV Q11, BV Chợ Rẫy.\",\"Tiện nghi:\",\"Phòng Box mới tinh, đầy đủ chăn ga gối nệm.\",\"Máy lạnh hoạt động 24/24, WC sạch sẽ và tiện dụng, bếp nấu ăn tại từng lầu.\",\"Có nhà để xe và bảo vệ 24/24.\",\"Giờ giấc tự do, khóa vân tay.\",\"Máy giặt và máy sấy.\",\"Liên hệ qua số điện thoại hoặc Zalo: 0336232904 (Huy Hoàng) - chính chủ, để được xem phòng trực tiếp!\"]', '52231829-3373-4bb5-8568-08bcb18e2700', 'e0966828-4c5d-46b4-86af-b87f9263f9e4', '3b2ee120-ee63-4182-a645-96c884975eba', '2024-09-20 16:13:21', '2024-09-20 16:13:21'),
('08cb9d9b-7eed-4269-bfe0-f23efdccf5bc', 'Cho thuê căn hộ mini DTSD 25m2, có gác xép, Quang Trung, P11, Gò Vấp', '0', 'MOJ1', 'Địa chỉ: 597/49 Đường Quang Trung, Phường 11, Quận Gò Vấp, Hồ Chí Minh', '4854e38d-c3da-4afe-8211-7ea925c195bd', 'NCT', '[\"Cho thuê căn hộ mini có gác xép, khép kín, lối đi riêng.\",\"Khu vực an ninh tốt, thuận tiện, kế bên siêu thị Coopmark Quang Trung, P11, Gò Vấp.\",\"Hiện có thể dọn vào ở ngay.\",\"Chủ nhà thiện chí cho thuê lâu dài.\",\"Ưu tiên hộ gia đình hoặc nữ.\"]', '9e435b03-528c-4ce0-a9c5-b141cccb806c', '5c15d4db-6ab5-4fe3-a010-99b095d3b552', '31b5a915-7be4-415a-b6f1-0861492afed8', '2024-09-20 16:09:10', '2024-09-20 16:09:10'),
