('0ed45ea8-b021-4d6e-ac22-e5d5e9132560', 'KTX SIÊU CAO CẤP - CHỈ 1tr5 /Người Bao Gồm Tất Cả Phí Bạn Sẽ Ở Trong SIÊU BIỆT THỰ ĐẸP LUNG- Gần Hutech', '5', 'SCC6', 'Địa chỉ: 643/24/3c Đường Xô Viết Nghệ Tĩnh, Phường 26, Quận Bình Thạnh, Hồ Chí Minh', '5335fe35-f274-434b-9c36-71dd3197e58f', 'CTPT', '[\"KTX cao cấp trong biệt thự siêu sang chuẩn 5 sao chỉ 1tr5/người (miễn phí điện nước).\",\"Bạn mệt mỏi vì phải ở trong các phòng trọ chật chội, nóng bức. Bạn phiền lòng vì không thể gánh chi phí cho một căn phòng đầy đủ tiện nghi.\",\"Hãy đến với chúng tôi, hệ thống phòng cho thuê chuyên nghiệp Trust Home.\",\"- phòng mới 100%, gần trường Giao thông vận tải, Hutech, Văn Lang, Ngoại thương,...\",\"+ Trang thiết bị:\",\"- giường tầng cao cấp có vách ngăn.\",\"- tủ quần áo\",\"- Máy Lạnh\",\"- tủ lạnh\",\"- kệ bếp + bếp từ.\",\"- nước uống.\",\"- nước nóng lạnh.\",\"- máy giặt.\",\"- internet 160Mb.\",\"- Phòng sinh hoạt, đọc sách hiện đại.\",\"- 2 Thang máy.\",\"- Lễ Tân + camera + bảo vệ (24/24)\",\"*Yêu cầu chung:\",\"- Nam/Nữ tuổi từ 17 - 28 tuổi Sống hòa đồng, giúp đỡ lẫn nhau, ý thức tự giác cao.\",\"- Có thông tin về bản thân rõ ràng (CMND,thẻ sinh viên, có xác nhận nơi làm việc).\",\"Giá: 1.500.000/ người (không phát sinh).\",\"Chi nhánh 1 : 643/24/3c Xô Viết Nghệ Tĩnh, Phường 26, quận Bình Thạnh.\",\"( Duyên 0385963709)\",\"Chi Nhánh 2 : 105/3 Bình Quới, P27, Bình Thạnh.\",\"( Hương 037 7805475 )\",\"Hãy gọi ngay: 0385963709 Duyên để được xem và thuê phòng.\"]', '388b5f5b-cd71-4dc0-90c8-992b13b38285', '878e98ff-dff2-47fa-86d5-dcd849409716', '8cd2a00f-c1a8-402e-8fb7-84572b28f03c', '2024-09-20 16:12:00', '2024-09-20 16:12:00'),
