('1aa7c0c1-d0a9-4484-a03f-68a1b3be54cc', 'Sleep box, ký túc xá Thủ Đức giá rẻ 1.4 tr/tháng bao hết chi phí, có cho thuê ngắn hạn 120K/ngày', '5', 'ANR1', 'Địa chỉ: Redhome Dorm Đường số 6, Phường Linh Xuân, Quận Thủ Đức, Hồ Chí Minh', '1a6e7cc3-9d4f-42bd-9fdf-318b28b15e30', 'CTPT', '[\"Tiết kiệm chi phí sinh hoạt cùng Red Homes Dorm với thiết kế đầy đủ công năng, tiện ích và tiện nghi với chi phí thấp nhất.\",\"- Phong cách thiết kế hiện đại, Wc riêng biệt cho mỗi phòng và đều có máy lạnh + tủ lạnh.\",\"- Giường tầng thiết kế hiện đại với màu sắc trang nhã, có đầy đủ nệm cao su, rèm vải, thiết bị vật dụng như góc học tập riêng.\",\"- Mỗi thành viên có tủ quần áo riêng, kệ giày, kệ vali, bàn xếp.\",\"- Phòng sinh hoạt chung có đầy đủ thiết bị dụng cụ tự phục vụ như nấu ăn, coffee, đọc sách, làm việc, chơi nhạc, sinh hoạt nhóm hoặc hoặc tiếp khách.\",\"- Máy lạnh, nước nóng năng lượng, khóa vân tay, thẻ từ, camera an ninh, thiết bị PCCC, lối thoát nạn khẩn cấp theo đúng tiêu chuẩn và qui định mới.\",\"- Xe máy miễn phí, xe hơi 50.000/ngày hoặc 1.200.000/tháng.\",\"Hiện Red Homes đang có 2 chi nhánh đa dạng sự lựa chọn cho các bạn sinh viên với các khung giá:\",\"- Giá: 1.450.000đ - 1.650.000đ (tùy phòng từ 04/06/08/09ng) tại Cơ sở 1.\",\"- Giá: 1.650,000đ, 1.700.000đ, 1.750.000đ, 1.900.000đ (tùy phòng từ 06/08/10ng) tại Cơ sở 2.\",\"* Đã bao hết chi phí (Điên, nước, xà bông giặt, xà bông rửa tay, rửa chén), có máy lọc nước uống, tắm nước nóng NLMT, xe máy miễn phí.\",\"Vị trí thuận lợi: Cạnh khuôn viên ĐHQG, rất thuận lợi để đi tới giảng đường các trường ĐH (ĐH Kinh Tế Luật, ĐH Nông Lâm, ĐH SPKT, ĐH Công nghệ thông tin, ĐH Thể Dục Thể Thao, ĐH KHTN - ĐHQG, ĐH Quốc Tế... ).\",\"Cơ Sở 1: 74/1 Đường số 6, P Linh Xuân, Tp. Thủ Đức.\",\"Cơ Sở 2: 16 Đường số 2, P Linh Xuân, Tp. Thủ Đức.\",\"Red Home đang có chương trình ưu đãi (cơ sở 2)\",\"- KM cho 03 khách đầu tiên (miễn phí 100% tháng đầu cho hđ 12 tháng).\",\"- KM cho 05 khách tiếp theo (giảm 70% tháng đầu cho hđ 12 tháng).\",\"- KM cho 10 khách tiếp theo (giảm 50% tháng đầu cho hđ 12 tháng).\",\"REDHOMES luôn lắng nghe và hỗ trợ bạn, hãy gọi cho mình bạn nhé.\"]', '6531fcb3-1efc-4c25-976e-d67bd0721928', 'b3aa42f7-d6ee-4519-9e42-0d4e8b8cd1a8', 'e4557d9a-1429-48ea-81a3-a7a165024abb', '2024-09-20 16:12:00', '2024-09-20 16:12:00'),
