('5b298e98-1417-49e5-8e8a-353776e2d9ce', 'Cho Thuê Nhà có 50m2 nhà, 2000m2 vườn Giá 2,5tr cách TP Bắc Giang~ 6km', '0', 'WOA3', 'Địa chỉ: Xã Tân Dĩnh, Huyện Lạng Giang, Bắc Giang', '75363798-163a-4fbd-8b6b-243287b60f41', 'NCT', '[\"Chính chủ Cần cho thuê Nhà ở tại thôn Dĩnh Lục I, xã Tân Dĩnh, huyện Lạng Giang, Bắc Giang; Cách T.Tâm T.Phố Bắc Giang ~ 6 km (đường thẳng); Rất phù hợp với các hộ gia đình cán bộ, công nhân để Ở, để NGHỈ DƯỠNG; có thể kết hợp chăn nuôi, thả cá, trồng cây ngắn ngày; Nhà vườn rộng, yên tĩnh; Ô tô vào tận sân.\",\"Nhà ở có diện tích trên 2.000 m2 đất đã trồng cây và 50 m2 nhà+kho nhỏ, 50 m2 sân, 50 m2 ao. Nhà gồm 25 m2 nhà ở chính và 20 m2 khu phụ có phòng ngủ nhỏ, Bếp, Xí, Tắm ốp lát gạch men; Bếp có đủ bàn bếp, chậu rửa, tủ tường; Nhà xí tự hoại, bệ xí bệt.\",\"Vườn đã trồng nhiều cây ăn quả như bưởi, nhãn, mít, ổi, hồng xiêm, trứng gà, dứa... và nhiều loại cây xanh, cây ăn quả khác. Vườn cũng có nhiều mảnh đất để trồng khoai, rau đậu, mướp, cây gia vị, cây thuốc, cây cảnh... rất thích hợp cho các ông bà ở cùng chăm cây, nghỉ dưỡng.\",\"Vườn rộng, phẳng, xung quanh được xây tường gạch cao, cổng sắt (dễ chăn thả gà, vịt, thỏ...); Ao nhỏ nhưng đã xây bờ bao, xung quanh trồng lộc vừng đã cao, to, phủ bóng mát xuống ao, có thể thả cá, câu cá;\",\"Khu nhà vườn rộng, mát, yên tĩnh, đảm bảo tính riêng tư của các thành viên trong gia đình (Chủ nhà không ở cùng).\",\"Ba cạnh của vườn là đường bê tông, ô tô chạy. Từ đường gom dân sinh (của đường cao tốc B.Giang-Lạng Sơn) vào tới vườn ~1,5 km.\",\"Hệ thống điện, nước đầy đủ, độc lập, tiện lợi.\",\"Với diện tích đất trên 2000 m2 và gần TP Bắc Giang, ngoài nhu cầu ở, nghỉ dưỡng, chủ nhà cũng sẵn sàng cho thuê để làm dịch vụ, kinh doanh, nghề phụ phù hợp.\",\"LH với Chủ nhà qua ĐT/Zalo: 0986095601\"]', '1d00d3cd-e148-42e8-b113-21b543e1c294', '709eeac4-82e0-459d-a546-778e182808cf', 'fa210763-7746-4b21-8acb-07ba11816270', '2024-09-20 16:09:10', '2024-09-20 16:09:10'),
('5cdc3197-ea03-4aa4-902b-6e34dc708803', 'Cho thuê nhà phú nhuận hẻm 3m cách hẻm xe hơi 1 căn trệt 2 lầu giá 5.5tr', '0', 'EOT9', 'Địa chỉ: 120 Đường Thích Quảng Đức, Phường 4, Quận Phú Nhuận, Hồ Chí Minh', '7c295897-396d-4507-a053-40fa52d1bb8f', 'NCT', '[\"Cho thuê nhà Thích quảng đức P4 Phú Nhuận , trêt 2 lầu, nhà mới gồm 3 toiet mỗi tầng 1 toilet , hẻm thông thoáng, hẻm rông 3m, cách hẻm xe hơi 1 căn, cách mặt tiền 50m, cách siêu thị nguyễn kiệm 300m\",\"Diện tích đất 12m2 , diện tích sàn 36m2, ở được 3-4 người, tầng trệt để được 2 xe máy,\",\"Thuê 1-2 năm , ưu tiên cho thuê dài hạn\",\"Giá giảm: 5.5tr/tháng cho năm đầu cho ai ký 2 năm\",\"Liên hệ a Long chủ nhà 0766802468 , thank\"]', 'c427216f-4308-4123-a1b9-d03d5d7b45e4', '08b40922-7433-4126-a2ee-5e8ce82d0ac5', '4ea62ccd-1b97-4abc-97d5-a2a99ae111de', '2024-09-20 16:09:10', '2024-09-20 16:09:10'),
('5feda82a-f30d-46ab-9f72-c0be5e6025fe', 'Căn hộ 38m2 chung cư D\'gold 1PN chính chủ trung tâm KDC vĩnh lộc', '0', 'YAQ1', 'Địa chỉ: 68 Hương lộ 80, Phường Bình Hưng Hòa B, Quận Bình Tân, Hồ Chí Minh', '7a802df9-e447-4d5c-a20d-565990bf0c39', 'CTCH', '[\"Căn hộ mới xây xong hoàn thiện , điện tích 38m2 , Nội thất cơ bản , Thích hợp ở hộ gia đình hoặc 3,4 người trở lên . Nhà mới bàn giao .\",\"Có 6 thang máy nên không lo chậm trễ giờ cao điểm . Chỗ để xe rộng rãi ,thoải mái ,có chỗ sạc xe điện , bãi xe hơi còn trống nhiều .\",\"Điện nước giá nhà nước.\",\"Xung quanh đầy đủ các tiện ích , trường học , bệnh viện , khu vui chơi , chợ,khu công nghiệp , chạy vô thành phố chỉ 5km .\",\"Khuôn viên rộng có sân chơi cho trẻ em và người lớn tuổi , bảo vệ nội bộ , bảo mật 3 lớp an toàn cho mọi cư dân trong chung cư .\",\"Gió mát lạnh cả ngày không cần bật quạt .\",\"View nhìn vào thành phố đẹp\",\"Đặt biệt gần các chợ khu công nhân với giá cả rẻ , phù hợp mọi người .\",\"Liên hệ chính chủ : Mr.Long\"]', 'a3254cdc-b6a5-488e-a3f4-2a18f5c256e3', '7b97a1a2-a35b-4a24-818c-1d05ab629118', '5e1b4488-abbf-4cf2-b839-69e32f3d3213', '2024-09-20 16:06:37', '2024-09-20 16:06:37'),
('61f63cd4-82e7-4828-88a4-015dcdd38340', 'Cho thuê nhà 2 phòng ngủ, P. Trường Thọ, Q. Thủ Đức cũ', '0', 'BFN9', 'Địa chỉ: Đường số 6, Phường Trường Thọ, Thủ Đức, Hồ Chí Minh', '127f9973-41fa-4218-b0b4-e3e6142557f5', 'NCT', '[\"- Cho thuê nhà nguyên căn.\",\"- 2 phòng ngủ, mỗi phòng đều có máy lạnh.\",\"- Khu dân cư an ninh, trật tự, ngay trung tâm Quận Thủ Đức cũ, gần trường học, bệnh viện, siêu thị, trung tâm thương mại,...\",\"- Điện, nước có đồng hồ riêng, tính theo giá nhà nước.\",\"- Nhà chính chủ, liên hệ chính chủ, không qua môi giới.\"]', '6c209657-d9ed-4178-97fd-3e5644f89db2', '9795f66e-d5c7-440c-b94a-14d71d449405', 'f434783b-5043-43fe-8918-bade99ebb211', '2024-09-20 16:09:10', '2024-09-20 16:09:10');
