('6576047e-9bd0-4670-b631-f10e4b66dc0a', 'Ở ghép trọn gói 800k ngay cầu Khánh Hội', '2', 'AXD2', 'Địa chỉ: 84 Đường Nguyễn Tất Thành, Phường 12, Quận 4, Hồ Chí Minh', 'd69fce5d-4d48-451c-b60f-2c0073840a24', 'TNOG', '[\"Homestay Hoàng Phúc - CAO CẤP - ĐẦY ĐỦ TIỆN NGHI - CHUẨN 2 SAO- Trọn gói chỉ 800k - các tháng sau chỉ từ 1tr đã bao gồm: tiền phòng, điện nước, máy giặt, giữ xe, máy lạnh,wifi, máy tắm nước nóng, nước uống... ( Cam kết không phát sinh).\",\"Tiện ích :\",\"- Giường tầng thoáng mát, rộng rãi.\",\"- Tủ quần áo.\",\"- Máy tắm nước nóng.\",\"- Máy lạnh.\",\"- Máy giặt.\",\"- Nhà bếp tiện nghi đầy đủ dụng cụ.\",\"- Nước uống miễn phí.\",\"- Internet 72 Mbps.\",\"- Phòng sinh hoạt, phòng khách, đọc sách tiện nghi.\",\"- Máy tắm nước nóng.\",\"- Sân phơi đồ rộng rãi, dàn phơi thông minh.\",\"- Có camera an ninh,có bảo vệ.\",\"- Có người dọn vệ sinh MIỄN PHÍ.\",\"- Nhà vệ sinh với thiết bị cao cấp (vòi sen, lavabo,...), nước nóng lạnh.\",\"- Giờ giấc tự do\",\"- Giữ xe miễn phí.\",\"Chi phí sinh hoạt, ăn uống khu vực xung quanh cực dễ chịu, gần siêu thị Coop mart, Ngay Phú Mỹ Hưng...tiện đi lại các quận trung tâm và quận 7.\",\"Yêu cầu: người đi làm có lí lịch rõ ràng, công việc ổn định hoặc học sinh, sinh viên.\",\"Địa chỉ: 84 Nguyễn Tất Thành p12 q4\",\"———— Địa chỉ: Các chi nhánh q7————\",\"Cs1: 34 đường 36 P. Tân Quy, Q7 (Cách Lotte Mart chỉ 400m )\",\"Cs2: 1134/4 Huỳnh Tấn Phát, Q7( sau lưng Phú Mỹ Hưng )\",\"Cs3: Hẻm 350 Huỳnh Tấn Phát,Q7 (Cách KCX Tan thuan, ĐH Tài Chính Marketing chỉ 500m)\",\"Các chi nhánh quận khác:\",\"Cs4: 233/11/6 Nguyễn Trãi, P2, Q5\",\"Cs5: 84 Nguyễn tất thành Q4- cách đại học Luật 200m, đại học Nguyễn Tất Thành.\",\"Cs6: Hẻm C4 đường Phạm Hùng Q8 (Gần siêu thị Satra) đến gọi mình ra đón\",\"Hình ảnh và thông tin đúng 100%.\",\"️ Hotline:\"]', '41ab42f4-330f-4145-b27b-958ecefde597', '31b46ba9-4a14-4ae6-bb45-af765424aa2d', '72755c92-ed3e-4e0c-9300-6b58822653eb', '2024-09-20 16:13:21', '2024-09-20 16:13:21'),
('663ec2b9-5650-4bd0-9ae1-ef573e2101e1', 'CĂN HỘ TÁCH BẾP SÂN THƯỢNG RIÊNG CHO THUÊ - LÝ THƯỜNG KIỆT', '0', 'ZDH7', 'Địa chỉ: 257/9 Phố Lý Thường Kiệt, Phường 15, Quận 11, Hồ Chí Minh', 'e2b25efb-739d-485f-88a1-7c430bf8a80a', 'CTCH', '[\"CĂN HỘ TÁCH BẾP SÂN THƯỢNG RIÊNG CHO THUÊ - LÝ THƯỜNG KIỆT\",\"Đối diện ĐH Bách Khoa, thuận tiện qua Q10, Tân Bình, Q3,...\",\"Căn hộ mini thu nhỏ tiện nghi\",\"1 phòng ngủ + bếp riêng\",\"Sân thượng rộng riêng của phòng\",\"Giá 6tr/tháng\",\"call/zl: .. hoặc ib em xem phòng nhaaa\"]', '08d5d2e6-d34a-45b5-b69c-002819fa55f3', '57c6d19a-a02c-4307-9963-d3552b67a1a2', '0fbb0c16-a211-4ee7-8288-3dbb986e7beb', '2024-09-20 16:06:37', '2024-09-20 16:06:37'),
('6f70fd2c-d56d-404e-911a-0ce7cbf51142', 'Cho thuê phòng trọ mới sửa 7/2023 Đường Lương Thế Vinh, Phường Tân Thới Hòa, Quận Tân Phú (gần Đầm Sen)', '5', 'SSN3', 'Địa chỉ: 48/13 Đường Lương Thế Vinh, Phường Tân Thới Hòa, Quận Tân Phú, Hồ Chí Minh', '16e08131-ce35-4949-9f95-3b29065e949e', 'CTPT', '[\"Giá Phòng từ 1800k. Đang còn phòng 1800K đến xem đảm bảo ưng ý, cam kết hình đúng với thực tế.\",\"Phòng mới sửa chữa 7/2023, địa chỉ 48/13 Lương Thế Vinh Phường Tân Thế Hòa, Q.Tân Phú, nhà hẽm xe hơi lộ giới 5m, lắp đặt hệ thống phòng cháy chữa cháy 9/2023\",\"Diện Tích 12m + 8m ( gác lững )\",\"Phòng có tolet riêng, cửa sổ, ban công, có phòng dưới trệt\",\"Cho nấu ăn trong phòng, Ở được 2-4 người, bạn bè lại chơi thoãi mái.\",\"Miễn phí internet, wifi, truyền hình cáp, Camera 15 cái ( an ninh quan sát không góc chết )\",\"Phòng Cháy Chữa Cháy lắp đặt từng phòng, lối đi, nơi để xe, xung quanh nhà đầy đủ\",\"Để xe trong sân nhà thoáng mát có người trông coi xe cộ.\",\"Vị trí gần Đầm Sen, thuận tiện qua lại Q.6, Q.11, Tân Phú\",\"Điện 3,5k/ 1 ký, nước 100k / 1 người, xe 100k/ 1 chiếc .\",\"Xe để sân sau nhà có người quản lý và trông coi ( không chung chủ ) giúp bạn có cảm giác an toàn, thoải mái\",\"LH : 0938864405 (Cường Phạm )\",\"LH zalo : 0938864405 ( Cường Phạm )\"]', '8991948d-5231-4e7e-b6a1-fa882e6a886d', '2111740b-7675-4ee5-a47a-b9bf7edb9dcf', 'daa5851e-e619-4b8c-8d2a-a8429778b3f1', '2024-09-20 16:12:00', '2024-09-20 16:12:00'),
('709d3e94-8614-4170-a298-18abf64a1faa', 'Nhà nguyên căn 7,5 triệu (70m2) hẻm 88/69 Nguyễn Văn Quỳ, phường Phú Thuận, quận 7', '0', 'EEI7', 'Địa chỉ: 88/69 Đường Nguyễn Văn Quỳ, Phường Phú Thuận, Quận 7, Hồ Chí Minh', '383ce1c1-1d1c-4f47-9c5a-c6659fa4fcc7', 'NCT', '[\"Nhà nguyên căn cho thuê giá 7,5 triệu/ tháng\",\"+ Kết cấu: 1 trệt + 1 lầu gồm 3 phòng ngủ , 1 phòng khách + bếp , 1 sân vườn để được nhiều xe honda, máy lạnh inverter cho phòng ngủ, 1 cửa rào sân vườn + 1 cửa lớn 4 cánh + 1 cửa phụ thoát hiểm/ chống cháy bên hông nhà\",\"+ Diện tích sàn 4,7 *10\",\"+ Camera trong nhà và ngoài sân\",\"+ Điện, nước theo hóa đơn của điện lực Tân Thuận và cấp nước Nhà Bè.\",\"+ Khu dân cư yên tĩnh, chợ tự phát ngay trong hẻm, gần trường mầm non, cấp 1, các trung tâm siêu thị lớn.\",\"- Khách hoặc môi giới liên hệ và liên hệ vào buổi tối sau 18g vì tôi bận đi làm, không nghe máy được. Do hiện tại tôi ở quận 12, không có ở quận 7 nên khách liên hệ coi nhà vui lòng hẹn trước hoặc vào thứ 7 hàng tuần.\"]', '003a2530-3eae-48b2-8c34-a65876785015', '312bc9f4-50b6-4ba2-92c3-91db4070f440', 'ad668809-289b-4a54-856d-e50e94fba27a', '2024-09-20 16:09:10', '2024-09-20 16:09:10'),
