('e560c335-b44f-489d-ab98-3ca4a9ed9982', 'PHÒNG CỰC ĐẸP 5tr3 6tr3 7tr3 NGAY HUTECH ĐIỆN BIÊN PHỦ, HÌNH THẬT 100%', '5', 'YNW5', 'Địa chỉ: Đường Điện Biên Phủ, Phường 21, Quận Bình Thạnh, Hồ Chí Minh', 'f5005635-9ab3-4161-b36a-cfb5c099781f', 'CTPT', '[\"Còn 3 phòng cực đẹp giá 5.3 triệu - 6.3 triệu - 7.3 triệu, đầy đủ nội thất cao cấp đường Điện Biên Phủ, Quận Bình Thạnh, ngay ngã tư Hàng Xanh, ĐH Hutech, GTVT, Ngoại thương, vị trí thuận tiện rất gần trung tâm, chỉ 5 phút đến trung tâm Quận 1.\",\"Tất cả các thiết bị cao cấp riêng trong phòng (hình thật 100%): Máy giặt Electrolux, Smart TV Sony 50 inches, Máy lạnh Panasonic, Tủ lạnh, Bếp từ, Lò vi sóng, Phòng tắm sen cây đứng, Máy nước nóng Ferroli, bàn ăn, ghế, kệ trang trí, giường queen size, tủ quần áo,...\",\"Khu vực rất nhiều tiện ích xung quanh: TTTM Pearl Plaza, Landmark 81, siêu thị Coop Mart, Vinmart, cửa hàng tiện lợi Circle K, MiniStop, rạp chiếu phim CGV, California Gym, City Gym, Starbucks coffee, Highland coffee, trà sữa Gong cha, KOI, The Alley, Khu du lịch Văn Thánh, công viên Vinhomes Central Park.\",\"Chỗ để xe miễn phí (tối đa 2 xe). Vui lòng không nuôi thú cưng.\",\"Giá thuê: 5.3 triệu - 6.3 triệu - 7.3 triệu. Vui lòng liên hệ chính chủ chỉ bằng ZALO 0903826821.\"]', '181f835e-7958-4d90-a705-23c82c7e1aa4', '92dd4826-b786-4c21-a0c6-4b2b0da4c378', '74468058-d214-4744-b528-a8a1ca3577ab', '2024-09-20 16:12:00', '2024-09-20 16:12:00'),
('e63397fa-6925-49ca-895e-1947fa28a7e1', 'KHAI TRƯƠNG KÝ TÚC XÁ MỚI TẠI TRUNG TÂM GÒ VẤP Gân HUI, VLU3, Sân bay TSN...', '5', 'HGM9', 'Địa chỉ: 83 Đường Trần Thị Nghĩ, Phường 7, Quận Gò Vấp, Hồ Chí Minh', '36ae1e69-436b-4390-a8cb-8c84990c4368', 'CTPT', '[\"- Khu vực sạch sẽ, an ninh, yên tĩnh, nhiều khuôn viên, cây xanh…\",\"- Ký túc xá riêng tư, tiện nghi, sạch sẽ.\",\"- Trang thiết bị mới, hiện đại.\",\"- Nhà để xe rộng rãi, giờ giấc tự do.\",\"- Bảo vệ, camera 24/24; khóa vân tay.\",\"- Dịch vụ vệ sinh đến từng phòng hàng tuần.\",\"- Bếp điện từ, tủ lạnh, bình điện siêu tốc, máy lọc nước, phòng sinh hoạt chung tiện nghi luôn sẵn sàng để phục vụ cho bạn.\",\"- Máy giặt free cùng không gian phơi đồ thoáng đãng giúp bạn không phải lo lắng về chuyện giặt ủi áo quần.\",\"- Giường thiết kế riêng tư, thoải mái, gối, ga, nệm, bàn học, đèn học, tủ cá nhân… tất cả đều có trên giường của mỗi cá nhân.\"]', 'caaa8cac-3cea-41a6-aeed-e756a70fda71', '06b6c8b1-3a26-4aa3-9bb4-74ec2267be2b', 'bf096b7f-71f4-49a1-b952-84b9da11ffbc', '2024-09-20 16:12:00', '2024-09-20 16:12:00'),
('e663f5aa-c348-4c1b-8264-a641e08afc7f', 'Chuyên cho thuê phòng Cc Đức Khải- Q7 phòng tolet chung 1tr-2tr3 phòng master tolet riêng 3tr-4tr', '5', 'HND2', 'Địa chỉ: Nguyễn Lương Bằng, Phường Phú Mỹ, Quận 7, Hồ Chí Minh', '97e9313a-60d3-4985-913d-b566096fd654', 'CTPT', '[\"Chuyên cho thuê phòng share chung cư Era Town Đức Khải, 15B Nguyễn Lương Bằng, Quận 7.\",\"Tiện ích chung cư chợ, trường học, siêu thị, quán ăn, cafe, gym spa,... Đầy đủ bán kính 100m ngay chung cư.\",\"Giá phòng tolet chung diện tích 5 - 12m² phòng mới từ 1tr - 2tr3 có khu bếp, khu phơi và bếp nấu chung (đặc biệt số luợng có hạn phòng có máy lạnh và tủ quần áo mới).\",\"Giá phòng từ 3tr - 4tr là phòng master có tolet riêng trống hoặc có nội thất cơ bản diện tích 17 - 30m².\",\"Chủ nhà thân thiện, dễ tính, trong quá trình ở bị hư hỏng điện nước đều được sữa chữa miễn phí.\",\"Sinh viên mới lên SG vui lòng đọc kỹ bài viết tra cứa địa chỉ vị trí và ib zalo nếu cần thêm thông tin chi phí điện nước và hình ảnh thực tế.\",\"Cảm ơn..!\"]', '4f0a3e3f-5a9f-4eef-80d8-d9103fbde322', '9a7242e1-c160-43e4-a493-80ff0310e574', '7b4f6923-0d1e-4185-9185-799d18d9091a', '2024-09-20 16:12:00', '2024-09-20 16:12:00'),
('e749d929-c998-4c52-84e7-2deab2ba7a9f', 'Cho thuê văn phòng tầng 3, 26m2 tại số 77-79-81 Đào Duy Từ, Phường 05, Quận 10', '0', 'VEJ5', 'Địa chỉ: 77-79-81 Đường Đào Duy Từ, Phường 5, Quận 10, Hồ Chí Minh', '3396c2dd-8e0b-4393-9426-2bbf1133053e', 'CTMB', '[\"- Địa chỉ: số 77-79-81 Đào Duy Từ, Phường 05, Quận 10, TP Hồ Chí Minh\",\"- Diện tích trống: Tầng 3: 26m2\",\"- Giá thuê sàn VP: 12tr/tháng.\",\"Vị trí:\",\"- Gần ngã ba Nguyễn Tri Phương - Đào Duy Từ,\",\"- Cách Đại Học Kinh Tế 100m, chỉ 400m đến Sân vận động Thống nhất, ngã 6 Nguyễn Tri Phương 500m thuận tiện di chuyển.\",\"Tiện ích đặc biệt:\",\"- Văn phòng cho thuê quận 10 sở hữu view cửa kính thoáng đẹp, sàn lót thảm sang trọng; Tầng trệt có Vinmart\",\"- Mỗi tầng có WC nam/nữ riêng biệt; Quản lý tòa nhà 24/7\",\"- Ngay khu vực trường đại học, ngân hàng, các quán ăn, tiệm cafe, tạp hóa, photocopy...\",\"- Cách 50m có bãi giữ xe máy, ô tô thoải mái\",\"- Di chuyển thuận tiện qua quận Tân Bình, quận 1,3, 5,6, 8.\",\"Liên hệ số 0909748082 (Ms Bích) để trao đổi chi tiết.\"]', 'dfa31e7a-e4f9-4e30-9944-e75d68670459', '5a5f664c-e9d9-41ec-871e-25aff8c6070b', 'e8157865-dc36-459a-bcd2-2b4913bc32bd', '2024-09-20 16:07:38', '2024-09-20 16:07:38');
INSERT INTO `posts` (`id`, `title`, `star`, `labelCode`, `address`, `attributesId`, `categoryCode`, `description`, `userId`, `overviewId`, `imagesId`, `createdAt`, `updatedAt`) VALUES
('e84b9efc-a9e4-4543-892d-060bbb077749', 'Căn hộ 40m tách Bếp, Nội thất cao cấp - ngã tư Hàng Xanh, Quận Bình Thạnh', '2', 'VLD0', 'Địa chỉ: Đường Bạch Đằng, Phường 15, Quận Bình Thạnh, Hồ Chí Minh', '7138c8cc-88ef-4606-8cc7-95c5b2b9edd9', 'CTCH', '[\"Căn hộ 40m thiết kế hiện đại, Ban công, Cửa sổ lớn Full kính. Trang bị FULL nội thất cao cấp như hình. Giá thuê từ 8.5 triệu.\",\"Các tiện ích : Thang máy, Hệ thống PCCC hiện đại, Nước nóng NLMT, Máy lạnh, Tủ Lạnh, Khu vực Giặt Sấy\",\"View Landmark 81, Hầm xe rộng rãi, Hệ thống camera an ninh 24/24, Internet tốc độ cao. Cửa ra vô 2 lớp bảo mật\",\"Địa chỉ : 71 Bạch Đằng, Phường 15, Quận Bình Thạnh, Khu phố trung tâm, sầm uất ngay ngã tư Hàng Xanh.\",\"Chỉ mất 5 phút tới các trường ĐH : Hutech, ĐH Quốc Tế Hồng Bàng, ĐH Kinh Tế UEF, RMIT…5 phút qua Landmark 81, Quận 1, Q. Phú Nhuận\",\"Phù hợp với người đi làm, gia đình nhỏ, các bạn sinh viên, những ai đang tìm kiếm 1 không gian sống tiện nghi, văn minh, lịch sự.\",\"️ Liên hệ xem chính chủ: 036 545 9999. Không tiếp quảng cáo, Miễn TG, anh chị em môi giới vui lòng không gọi. Xin cảm ơn !\"]', '13c569e3-0039-4982-90bb-69bc7e748b20', 'e6349716-320c-40ec-9750-b248725573a4', '8d424080-4840-464c-b4fd-1377e0c7ab83', '2024-09-20 16:06:37', '2024-09-20 16:06:37'),
('f375fe04-09de-494f-bf80-24153e5be3df', 'Ở ghép trọn gói 700k máy lạnh, máy giặt,máy nước nóng- Phạm Hùng', '2', 'GSY1', 'Địa chỉ: Xã Bình Hưng, Quận 8, Hồ Chí Minh', 'b3a9b4fe-3f81-49a0-b188-eaa074ede47f', 'TNOG', '[\"Phòng Ký Túc Xá cao cấp chỉ 900 ngàn/tháng ( Tháng đầu giảm 200k ) Dịch vụ cung cấp bao gồm: mỗi người một giường riêng biệt,máy lạnh, tủ đựng đồ có chìa khóa riêng, máy tắm nóng lạnh, wifi, dọn phòng mỗi ngày.Phòng nam-nữ riêng biệt, có người quản lí và giữ xe, đặc biệt khu vực có nắp camera an ninh an toàn- lành mạnh.\",\"Địa chỉ hẻm C4 đường Phạm Hùng. Đến đầu hẻm gọi mình ra đón .Phòng như hình 100% nhé. Liên hệ: 0931313570 ( Mr.Phúc)\"]', '76631d39-d098-4470-9663-a2a90825cb6d', '86fe8166-b5fa-4cd3-8d15-e10e969d083d', 'dcb1ead4-87f0-4048-90e8-2bcdb9a4ecfd', '2024-09-20 16:13:21', '2024-09-20 16:13:21'),
('f5102ab7-449d-4061-b09c-90ee948390ba', 'Homestay Hoàng Phúc:Giường tầng trọn gói 700k ngay Lotte Mart', '2', 'FHW6', 'Địa chỉ: 436 Đường Nguyễn Thị Thập, Phường Tân Quy, Quận 7, Hồ Chí Minh', '818cdbf2-73a5-4d6c-a66d-ede474bad89e', 'TNOG', '[\"Đến Homestay Hoàng Phúc – chuỗi kytucxa q7 rẻ nhất Sài Gòn – bạn sẽ được sống trong những căn phòng đẹp lung linh chuẩn 2 sao, đa dạng tiện ích và được sinh hoạt trong không gian ấm cúng như chính ở nhà.\",\"Nhằm hỗ trợ tối ưu cho các sinh viên và người đi làm, hệ thống KTX Q7 chúng mình miễn phí toàn bộ các chi phí (cam kết 100% không phát sinh), các bạn chỉ cần vào ở với mức giá cố định 700.000 VNĐ/ tháng thôi nè!\",\"Tiện ích cá nhân ở ký túc xá:\",\"- Phòng giường tầng riêng tư, rộng rãi, có chăn ga gối nệm, tủ để đồ tại giường kèm hệ thống móc treo thông minh.\",\"- Giá cố định trọn gói, miễn phí tiền điện nước và các chi phí bổ sung khác.\",\"Tiện ích chung tại ký túc xá:\",\"- Phòng ở mới tinh tươm, được decor siêu xinh và đầy đủ đồ dùng thiết yếu.\",\"- Trang bị máy lạnh inventer, wifi tốc độ cao ở mỗi tầng.\",\"- Có nhà vệ sinh riêng, được dọn dẹp vệ sinh phòng hằng ngày.\",\"- Có phòng đọc sách, phòng sinh hoạt, phòng khách...rộng rãi và thoải mái.\",\"- Máy giặt, máy nóng lạnh, bình lọc nước,… được sử dụng thả ga.\",\"- Có nhà để xe rộng, bảo vệ kiểm tra tích hợp camera giám sát.\",\"- Giờ giấc tự do, môi trường sống văn minh thân thiện.\",\"- Khu nhà bếp đầy đủ tiện nghi, đồ dùng nấu nướng.\",\"- Có sân phơi quần áo rộng kèm hệ thống phơi thông minh.\",\"Tiện ích khu vực ký túc xá:\",\"- Vị trí nằm ở trung tâm, thuận lợi di chuyển đến các quận 4, quận 8, quận 5, quận 1,… trong thời gian ngắn.\",\"- Gần các trung tâm thương mại như siêu thị Lotte, siêu thị BigC, trường ĐH Tôn Đức Thắng, ĐH Tài Chính Marketing, KCX Tân Thuận,…\",\"- Mức sống khu vực dễ chịu, dễ dàng đi lại và ăn uống.\",\"Địa chỉ các cơ sở chi nhánh KTX:\",\"CN1: 34 đường 36, P. Tân Quy, Q7 (Cách Lotte Mart chỉ 400m).\",\"CN2: 1134/14A Huỳnh Tấn Phát, Q7 (sau lưng Phú Mỹ Hưng).\",\"CN3: Hẻm 350 Huỳnh Tấn Phát, Q7 (Cách KCX Tân Thuận, cách ĐH Tài Chính Marketing chỉ 500m).\",\"CN4: 233/11/6 Nguyễn Trãi, P2, Q5 gần KHTN, Đai học Sư Phạm.\",\"CN5: 84 Nguyễn Tất Thành, Q4 - cách đại học Luật 200m, đại học Nguyễn Tất Thành 300m.\",\"CN6: Hẻm C4 đường Phạm Hùng, Q8 (Gần siêu thị Satra).\",\"Thông tin liên hệ tư vấn và xem phòng: qua hotline 0931313570 (gặp anh Phúc) hoặc có thể đến trực tiếp xem trực tiếp.\"]', '46c1a04b-551f-40af-bbbe-2d5dc4fe2496', '2eec6146-6910-4f75-85c1-abaccfefd777', 'abc8262e-92f2-4d4b-8842-7b31e2e8e6c9', '2024-09-20 16:13:21', '2024-09-20 16:13:21'),
('fa72dca9-d0a3-41a3-8a06-2c759e689227', 'Cho Thuê Mặt Bằng View Sông Giá Tốt', '0', 'VZC5', 'Địa chỉ: 343 Hoàng Sa, Phường Tân Định, Quận 1, Hồ Chí Minh', 'bafccb52-bf10-414f-9a7b-ae5a84990bef', 'CTMB', '[\"Cho thuê mặt bằng mới xây tại 343 Hoàng Sa, phường Tân Định quận 1 TP.HCM.\",\"Toà nhà có vị trí đắc địa trong quận 1, nhìn trực tiếp ra công viên và kênh Nhiêu Lộc-Thị Nghè, hướng đón gió, rất mát mẻ và trong lành, vị trí tòa nhà gần cầu Kiệu, ngã tư Phan Xích Long - Phan Đăng Lưu, 15’ ra sân bay Tân Sơn Nhất, vị trí thuận lợi với lưu lượng giao thông lớn, thích hợp để quảng cáo thương hiệu công ty. Toà nhà phù hợp làm trụ sở văn phòng, hoặc quán cà phê, phòng trưng bày, phòng tập…\",\"Tiện ích tòa nhà 343 Hoàng Sa\",\"9m mặt tiền đường Hoàng Sa, Quận 1\",\"Tòa nhà mới xây và hoàn công đầu năm 2023\",\"Tiện ích đầy đủ: thang máy, thang bộ, máy lạnh, hệ thống chiếu sáng, báo khói…\",\"Miễn phí bảo vệ giữ xe từ 7:30 sáng đến 6:00 tối, thứ 2 đến thứ 6 hàng tuần\",\"Wifi miễn phí 24/7\",\"Mặt bằng trống, có sẵn 1 tủ lạnh 450l, một số bàn ghế văn phòng\",\"Đồng hồ điện, nước riêng\",\"Chỗ gửi xe riêng\",\"Có thể hoạt động vào thứ 7, chủ nhật\",\"Chấp nhận ký hợp đồng lâu dài\",\"Có thể xuất hoá đơn VAT\",\"Thông tin và giá thuê tòa nhà 343 Hoàng Sa\",\"Địa chỉ: 343 Hoàng Sa, phường Tân Định, quận 1, TP.HCM\",\"Diện tích: tầng 2 và/hoặc tầng 3 (72m2/ tầng)\",\"Giá cho thuê 1 tầng: 22.000.000đ\",\"Thời hạn cho thuê: tối thiểu 12 tháng\",\"Đặt cọc: 2 tháng\",\"Thanh toán: 1 tháng/ lần\"]', '27214c89-c448-4cfe-be2a-9538f5301c2b', '83c19cb9-5c6c-4319-8adc-a86a06c6b1bf', '5dfc6814-ce69-4441-bae4-19d7a781b918', '2024-09-20 16:07:38', '2024-09-20 16:07:38'),
('fedc020c-e25b-476d-8c39-56eccc08400a', 'Mặt bằng 30m2 dạng ki ốt, gần kề chợ Hiệp Bình', '0', 'OGT9', 'Địa chỉ: 4/1 37, Phường Hiệp Bình Chánh, Thủ Đức, Hồ Chí Minh', '6639661b-e112-4764-896a-e9cb0380fed4', 'CTMB', '[\"Mặt bằng dạng ki ốt , mặt tiền đường nhánh gần kề chợ Hiệp Bình\",\"Đường trước nhà 6m , xe hơi đậu\",\"Cửa chính riêng biệt, trong nhà có 1 wc\",\"Nằm trong khu dân cư cao cấp\",\"Phù hợp kd văn phòng nhỏ, spa , tiệm nail, làm tóc...\"]', '755103a6-ad20-40de-96c4-5e5074bb9f90', '39f54993-2c91-4547-a525-d44edc452e26', 'f1ef8262-728a-4e02-843e-13c47b0ee0a4', '2024-09-20 16:07:38', '2024-09-20 16:07:38');
